import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroImage from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchParams((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0 z-0">
        <img
          src={heroImage}
          alt="Background"
          className="w-full h-full object-cover"
          style={{
            filter: "brightness(0.9) saturate(0.8) opacity(0.9)",
          }}
        />
        <div
          className="absolute inset-0"
          style={{
            backgroundColor: "rgba(72, 126, 176, 0.05)",
            mixBlendMode: "multiply",
          }}
        />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-10 text-gray-600 hover:text-gray-800 transition-colors"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 max-w-4xl mx-auto pt-32 px-4">
        <h1
          className="text-5xl font-light text-gray-800 text-center mb-3"
          style={{
            fontFamily:
              "-apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue, sans-serif",
          }}
        >
          Let's Find Your Perfect Partner
        </h1>
        <p className="text-center text-gray-600 mb-12 text-lg font-light">
          Discover organizations that align with your mission and values
        </p>

        <div className="bg-white/90 backdrop-blur-md rounded-2xl shadow-lg p-8 space-y-8">
          <div className="space-y-6">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Location
              </label>
              <input
                type="text"
                name="location"
                placeholder="Enter city or region"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
                value={searchParams.location}
                onChange={handleChange}
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                What Kind of Organization Are You Looking For?
              </label>
              <select
                name="orgType"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all"
                value={searchParams.orgType}
                onChange={handleChange}
              >
                <option value="">Select organization type</option>
                <option value="nonprofit">Nonprofit Organization</option>
                <option value="corporate">Corporate Partner</option>
                <option value="social-enterprise">Social Enterprise</option>
                <option value="foundation">Foundation</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Partnership Goals
              </label>
              <textarea
                name="partnershipGoal"
                placeholder="Describe what you're looking to achieve through this partnership..."
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all h-32 resize-none"
                value={searchParams.partnershipGoal}
                onChange={handleChange}
              />
            </div>
          </div>

          <button className="w-full bg-gradient-to-r from-blue-500 to-teal-400 text-white py-4 rounded-xl font-medium hover:opacity-90 transition-opacity">
            Search Partners
          </button>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
